/* The default image preview
 * Saved here as base64 so that it's available to the Vercel Serverless Function
 * Note that files in the git repo, even in the public/ directory, are NOT available to Functions, per
 *      https://github.com/vercel/next.js/issues/8251
 *      https://vercel.com/knowledge/how-can-i-use-files-in-serverless-functions
 *
 * Generate the preview with something like this on macOS:
 *      base64 < defaultPreview_1200x628.png | pbcopy
 * and then paste it into this file.
 */

const defaultImagePreview_1200x628_Base64 =
  "";

const defaultImagePreview_1200x675_Base64 =
  "";

const defaultImagePreview_1200x628 = Buffer.from(
  defaultImagePreview_1200x628_Base64,
  "base64"
);
const defaultImagePreview_1200x675 = Buffer.from(
  defaultImagePreview_1200x675_Base64,
  "base64"
);

export default {
  openGraph: {
    image: defaultImagePreview_1200x628,
    width: 1200,
    height: 628,
  },
  twitter: {
    image: defaultImagePreview_1200x675,
    width: 1200,
    height: 675,
  },
};
